<h1 mat-dialog-title>Delete Packing List</h1>
<div mat-dialog-content>
  <p>Are you sure you want to delete {{data.packingListName}}?</p>
</div>
<div mat-dialog-actions align="end">
  <button mat-button [mat-dialog-close]="false">Cancel</button>
  <button mat-button [mat-dialog-close]="true" cdkFocusInitial color="warn">Delete</button>
</div>
